threeData.unitType.Machine.prototype.beopShowMachineName = function () {
    if (this.MachineNameMesh) {
        this.MachineNameMesh.rotation = this.room.camera.rotation;
        this.MachineNameMesh.visible = true;
    } else {
        var textGeo = new THREE.TextGeometry(this.opts.name, {
                font: 'helvetiker',
                size: 50,
                height: 5,
                extrudeMaterial: 1
            }),
            textMaterial = new THREE.MeshPhongMaterial({
                color: 0xfa0000
            });
        this.MachineNameMesh = new THREE.Mesh(textGeo, textMaterial);
        this.MachineNameMesh.position = new THREE.Vector3(0, -120, this.opts.position.z + 450);
        this.MachineNameMesh.rotation = this.room.camera.rotation;
        this.add(this.MachineNameMesh);
    }
};
threeData.unitType.Machine.prototype.beopHideMachineName = function () {
    if (this.MachineNameMesh) {
        this.MachineNameMesh.visible = false;
    }
};

